"H2148": "<span class=\"literal-meaning\">Zechariah = &quot;Jehovah remembers&quot;</span><ol><li> 11th in order of the minor prophets; a priest, son of Berechiah and grandson of Iddo, who, along with Haggai, directed the rebuilding of the temple in the days of Zerubbabel</li><li> king of Israel, son of Jeroboam II</li><li> son of Meshelemiah of Shelemiah, a Korhite, and keeper of the north gate of the tabernacle of the congregation</li><li> one of the sons of Jehiel</li><li> a Levite of the second order in the temple band in the time of David</li><li> one of the princes of Judah in the reign of Jehoshaphat</li><li> son of the high priest Jehoiada, in the reign of Joash king of Judah, who was stoned in the court of the temple</li><li> a Kohathite Levite in the reign of Josiah</li><li> the leader of the sons of Pharosh who returned with Ezra</li><li> son of Bebai</li><li> one of the chiefs of the people whom Ezra summoned in council at the river Ahava; stood at Ezra's left hand when Ezra expounded the law to the people</li><li> one of the family of Elam who had married a foreign wife after the captivity</li><li> ancestor of Athaiah or Uthai</li><li> a Shilonite, descendant of Perez, grandfather of Athaiah</li><li> a priest, son of Pashur</li><li> the representative of the priestly family of Iddo in the days of Joiakim the son of Jeshua; possibly the same as 1 above</li><li> one of the priests, son of Jonathan, who blew with the trumpets at the dedication of the city wall by Ezra and Nehemiah</li><li> a chief of the Reubenites at the time of the captivity by Tiglath-pileser</li><li> one of the priests who accompanied the ark from the house of Obed-edom</li><li> son of Isshiah of Jesiah, a Kohathite Levite descended from Uzziel</li><li> 4th son of Hosah, of the children of Merari</li><li> a Manassite, father of Iddo</li><li> father of Jahaziel. He prophesied in the spirit</li><li> one of the sons of Jehoshaphat</li><li> a prophet in the reign of Uzziah, who appears to have acted as the king's counsellor, but of whom nothing is known</li><li> father of Abijah or Abi, Hezekiah's mother</li><li> one of the family of Asaph in the reign of Hezekiah</li><li> one of the rulers of the temple in the reign of Josiah</li><li> son of Jeberechiah who was taken by the prophet Isaiah as one of the 'faithful witnesses to record' when he wrote concerning Maher-shalal-hash-baz</li></ol>",
