"H2605": "<span class=\"literal-meaning\">Canan or Hanan = &quot;he is merciful&quot;</span><ol><li> one of the chief people of the tribe of Benjamin</li><li> last of the 6 sons of Azel, a descendant of Saul</li><li> son of Maachah, one of David's mighty warriors</li><li> father of some sons who returned from exile with Zerubbabel</li><li> one of the Levites who assisted Ezra in his public exposition of the law</li><li> one of the heads of the people who also sealed the covenant with Nehemiah</li><li> another of the chief laymen who also sealed the covenant with Nehemiah</li><li> son of Zaccur, grandson of Mattaniah whom Nehemiah made one of the storekeepers of the provisions collected as tithes. Same as 5 ?</li><li> son of Igdaliah</li></ol>",
