"H2607": "<span class=\"literal-meaning\">Hanani = &quot;gracious&quot;</span><ol><li> one of the sons of Heman, a chief musician of David, and head of the 18th course of the service</li><li> a seer who rebuked Asa, king of Judah, and was imprisoned<ol><li> maybe, father of Jehu the seer who testified against Baasha</li></ol><li> one of the priests who in the time of Ezra took a foreign wife</li><li> brother of Nehemiah whom Nehemiah appointed governor of Jerusalem</li><li> another priest who was the chief musician under Nehemiah</li></ol>",
"H2608": "<span class=\"literal-meaning\">Hananiah = &quot;God has favoured&quot;</span><ol><li> the godly friend of Daniel whom Nebuchadnezzar renamed Shadrach; one of the three friends who with Daniel refused to make themselves unclean by eating food from the king's table which went against the dietary laws which God had given the Jews; also one of the three who were thrown into the fiery furnace for refusing to bow down to a graven image of Nebuchadnezzar and who were saved by the angel of the Lord. See also, 'Shadrach' (07714 or 07715)</li><li> one of the 14 sons of Heman and chief of the 16th course</li><li> a general in the army of King Uzziah</li><li> father of Zedekiah in the time of Jehoiakim</li><li> son of Azur, a Benjamite of Gibeon and a false prophet in the reign of Zedekiah king of Judah</li><li> grandfather of Irijah, the captain of the ward at the gate of Benjamin who arrested Jeremiah on the charge of deserting to the Chaldeans</li><li> a head of a Benjamite house</li><li> son of Zerubbabel from whom Christ derived His descent also called 'Joanna' by Luke</li><li> one of the sons of Bebai who returned with Ezra from Babylon</li><li> a priest, one of the makers of the sacred ointments and incense, who built a portion of the wall of Jerusalem in the days of Nehemiah</li><li> head of the priestly course of Jeremiah in the days of Joiakim</li><li> ruler of the palace at Jerusalem under Nehemiah and also, along with Hanani, the Tirshatha's brother, entrusted with the arrangements of guarding the gates of Jerusalem</li><li> Two post exilic Israelites</li></ol>",
