"H3160": "<span class=\"literal-meaning\">Jehubbah = &quot;hidden&quot;</span><ol><li> a man of Asher, son of Shomer or Shamer of the house of Beriah</li></ol>",
"H3161": "<ol><li> to join, unite, be joined, be united<ol><li> (Qal) to be united</li><li> (Piel) to unite</li></ol></li></ol>",
"H3162": "<ol><li> union, unitedness</li><li> together, altogether, all together, alike</li></ol>",
"H3163": "<span class=\"literal-meaning\">Jahdo = &quot;His unity&quot;</span><ol><li> a Gileadite, son of Buz and father of Jeshishai</li></ol>",
"H3164": "<span class=\"literal-meaning\">Jahdiel = &quot;my unity is God&quot;</span><ol><li> a chief of Manasseh on the east of the Jordan</li></ol>",
"H3165": "<span class=\"literal-meaning\">Jehdeiah = &quot;Jehovah is unity&quot;</span><ol><li> a Levite in the time of David</li><li> a Meronothite, officer of David in charge of the she-asses</li></ol>",
"H3166": "<span class=\"literal-meaning\">Jahaziel = &quot;beheld of God&quot;</span><ol><li> a Benjamite warrior who joined David at Ziklag</li><li> a priest in the reign of David who helped move the ark</li><li> a Kohathite Levite, 3rd son of Hebron</li><li> a Levite, son of Zechariah, of the sons of Asaph, in the reign of Jehoshaphat</li><li> an ancestor of one of the families who returned from exile with Ezra</li></ol>",
"H3167": "<span class=\"literal-meaning\">Jahaziah = &quot;Jehovah views&quot;</span><ol><li> son of Tikvah, apparently a priest and leader during the time of Ezra</li></ol>",
"H3168": "<span class=\"literal-meaning\">Ezekiel or Jehezekel = &quot;God strengthens&quot;</span><ol><li> son of Buzi and a priest and prophet; author of the book by his name; taken captive with Jehoiachin and exiled in Babylon where he prophesied for the next 22 years</li><li> a priest in charge of the 20th course in the time of David</li></ol>",
"H3169": "<span class=\"literal-meaning\">Hezekiah or Jehizkiah = &quot;Jehovah has made strong&quot;</span><ol><li> son of king Ahaz by Abi or Abijah and the 12th king of Judah; his reign was characterised by his godly conduct; reigned for 29 years</li><li> head of a family of returning exiles in the time of Nehemiah</li><li> an Ephraimite in the time of Ahaz</li></ol>",
"H3170": "<span class=\"literal-meaning\">Jahzerah = &quot;whom God leads back&quot;</span><ol><li> a priest of the house of Immer</li></ol>",
"H3171": "<span class=\"literal-meaning\">Jehiel = &quot;God lives&quot;</span><ol><li> a Levite and one of the chief musicians in the time of David</li><li> a Gershonite Levite who had charge of the treasures in the time of David</li><li> son of Hachmoni and an officer of David and tutor of David's sons</li><li> a son of king Jehoshaphat of Judah put to death by his brother Jehoram</li><li> Hemanite who took part in the restoration of king Hezekiah</li><li> a Levite and overseer in the time of Hezekiah</li><li> a ruler of the temple during the reforms of Josiah</li><li> father of Obadiah of the sons of Joab in the time of Ezra</li><li> father of Shechaniah of the sons of Elam in the time of Ezra</li><li> a son of Elam who put away his foreign wife in the time of Ezra</li><li> a priest of the sons of Harim who also had to put away his foreign wife in the time of Ezra</li></ol>",
"H3172": "<span class=\"literal-meaning\">Jehieli = \"God shall save alive\" or \"swept away of God\"</span><ol><li> a Gershonite Levite of the family of Laadan</li></ol>",
"H3173": "<ol><li> only, only one, solitary, one<ol><li> only, unique, one</li><li> solitary</li><li> (TWOT) only begotten son</li></ol><li> one</li></ol>",
"H3174": "<span class=\"literal-meaning\">Jehiah = &quot;Jehovah lives&quot;</span><ol><li> doorkeeper of the ark at the time of its establishment in Jerusalem</li></ol>",
"H3175": "<ol><li> waiting, hoping</li></ol>",
"H3176": "<ol><li> to wait, hope, expect<ol><li> (Niphal) to wait</li><li> (Piel)<ol><li> to wait, await, tarry</li><li> to wait for, hope for</li></ol><li> (Hiphil) to wait, tarry, wait for, hope for</li></ol></li></ol>",
