"H3190": "<ol><li> to be good, be pleasing, be well, be glad<ol><li> (Qal)<ol><li> to be glad, be joyful</li><li> to be well placed</li><li> to be well for, be well with, go well with</li><li> to be pleasing, be pleasing to</li></ol><li> (Hiphil)<ol><li> to make glad, rejoice</li><li> to do good to, deal well with</li><li> to do well, do thoroughly</li><li> to make a thing good or right or beautiful</li><li> to do well, do right</li></ol></li></ol></li></ol>",
