"H3204": "<span class=\"literal-meaning\">Jeconiah = &quot;Jehovah will establish&quot;</span><ol><li> son of king Jehoiakim of Judah and king of Judah for 3 months and 10 days before he surrendered to Nebuchadnezzar and was taken captive to Babylon where he was imprisoned for the next 36 years; released at the death of Nebuchadnezzar and lived in Babylon until his death<ol><li> primary spelling 'Jehoiachin'</li></ol></li></ol>",
