"H3240": "<ol><li> to rest<ol><li> (Qal)<ol><li> to rest, settle down and remain</li><li> to repose, have rest, be quiet</li></ol><li> (Hiphil)<ol><li> to cause to rest, give rest to, make quiet</li><li> to cause to rest, cause to alight, set down</li><li> to lay or set down, deposit, let lie, place</li><li> to let remain, leave</li><li> to leave, depart from</li><li> to abandon</li><li> to permit</li></ol><li> (Hophal)<ol><li> to obtain rest, be granted rest</li><li> to be left, be placed</li><li> open space (subst)</li></ol></li></ol></li></ol>",
