"H5416": "<span class=\"literal-meaning\">Nathan = &quot;giver&quot;</span><ol><li> a son of David by Bathsheba</li><li> the eminent prophet in the time of David and Solomon</li><li> a man of Zobah, father of one of David's mighty warriors</li><li> father of Azariah who was over the officers of Solomon</li><li> son of Attai and father of Zabad of the tribe of Judah</li><li> brother of Joel of the tribe of Judah</li><li> one of the head men who returned from Babylon with Ezra</li><li> a man with a foreign wife in the time of Ezra</li><li> head of a family of Israel who shall mourn when they look on Him whom they pierced</li></ol>",
"H5417": "<span class=\"literal-meaning\">Nethaneel = &quot;given of God&quot;</span><ol><li> son of Zuar and a chief of the tribe of Issachar at the exodus</li><li> the 4th son of Jesse and a brother of David</li><li> a priest in the reign of David who blew the trumpet before the ark when it was brought from the house of Obed-edom</li><li> a representative of the priestly family of Jedaiah in the time of Joiakim</li><li> a priest of the family of Pashur who had a foreign wife in the time of Ezra</li><li> a Levite, father of Shemaiah the scribe in the reign of David</li><li> a Levite, son of Obed-edom</li><li> a chief of the Levites in the reign of king Josiah of Judah</li><li> a prince of Judah in the reign of king Jehoshaphat of Judah who was sent by the king to teach in the cities of the kingdom</li><li> a Levite of the sons of Asaph who played a musical instrument at the dedication of the wall of Jerusalem<ol><li> perhaps the same as 5</li></ol></li></ol>",
"H5418": "<span class=\"literal-meaning\">Nethaniah = &quot;given of Jehovah&quot;</span><ol><li> son of Elishama of the royal family of Judah and father of Ishmael who murdered Gedaliah</li><li> father of Jehudi</li><li> a Levite, one of the 4 sons of Asaph the minstrel</li><li> a Levite in the reign of king Jehoshaphat of Judah</li></ol>",
