"H5662": "<span class=\"literal-meaning\">Obadiah = &quot;servant of Jehovah&quot;</span><ol><li> the 4th of the 12 minor prophets; nothing personal is known of him but it is probable that he was contemporary with Jeremiah, Ezekiel, and Daniel<ol><li> the prophetic book by him; prophesies against Edom</li></ol><li> father of Ishmaiah, one of the chiefs of Zebulun in the time of David</li><li> a Merarite Levite overseer of the work of restoring the temple in the time of king Josiah of Judah</li><li> chief of the household of king Ahab of Israel; an devout worshipper of Jehovah who at risk to his own life hid over 100 prophets during the persecution of Jezebel</li><li> a descendant of David</li><li> a chief of the tribe of Issachar</li><li> a Benjamite, one of the 6 sons of Azel and a descendant of king Saul</li><li> a Levite, son of Shemaiah and a descendant of Jeduthun</li><li> a Gadite chief, the 2nd of the lion-faced Gadites who joined David at Ziklag</li><li> a prince of Judah in the time of king Jehoshaphat of Judah</li><li> a priest, son of Jehiel of the sons of Joab who returned from exile with Ezra</li><li> a gatekeeper in the time of Nehemiah</li><li> one of the men who sealed the covenant with Nehemiah<ol><li> perhaps the same as 12</li></ol></li></ol>",
