"H5793": "<span class=\"literal-meaning\">Uthai = &quot;helpful&quot;</span><ol><li> son of Ammihud and a descendant of Pharez of Judah</li><li> one of the sons of Bigvai who returned from exile with the 2nd caravan with Ezra</li></ol>",
