"H5803": "<span class=\"literal-meaning\">Azgad = &quot;Gad is mighty&quot;</span><ol><li> ancestor of a family of laymen who returned from exile with Zerubbabel</li><li> a man who sealed the covenant with Nehemiah</li></ol>",
